parameters.jsCode:
const markdown = $json.markdown;
const fileName = $json.id;
const annotation = $json.image_annotation;

// Define image markdown pattern
const imageMarkdown = `![${fileName}](${fileName})`;

// Only proceed if both annotation and markdown exist
if (annotation && markdown && markdown.includes(imageMarkdown)) {
  const annotationText = `\n> **Annotation:** ${annotation.trim()}\n`;
  const updatedMarkdown = markdown.replace(
    imageMarkdown,
    `${imageMarkdown}${annotationText}`
  );

  return {
    json: {
      markdown: updatedMarkdown
    }
  };
}

// If annotation is missing or markdown doesn’t reference the image, return original markdown
return {
  json: {
    markdown: markdown || ""
  }
};
